const Diaryitem = () => {
    return (
        <div className='Diaryitem'>
            <div key={it.id}>
                    <div>작성자 : {it.author}</div>
                    <div>일기 : {it.content}</div>
                    <div>감정 : {it.emotion}</div>
                    <div>작성시간 : {it.created_date}</div>
                    <div>------------</div>
                </div>
        </div>
    );
};

export default Diaryitem;
